import React from "react";
import {BrowserRouter as Router, Switch, Link, Route} from "react-router-dom";
import Container from '@material-ui/core/Container';
import Box from '@material-ui/core/Box';
import CssBaseline from '@material-ui/core/CssBaseline';
import Home from "./Home";
import Identity from "./Identity";
import SubScription from "./SubScription";
import GuideOverView from "./GuideOverView";
import PlanOfAction from "./PlanOfAction";
import GuideRecruit from "./GuideRecruit";
import InternShip from "./InternShip";
import Recruit from "./Recruit";
import GuideFacility from "./GuideFacility";
import Hall from "./Hall";
import GuideService from "./GuideService";
import Tour from "./Tour";
import TourAlbum2018 from "./TourAlbum2018";
import TourAlbum2019 from "./TourAlbum2019";
import TourAlbum2020 from "./TourAlbum2020";
import TourAlbum2021 from "./TourAlbum2021";
import PrintService from "./PrintService";
import Support from "./Support";
import GuideEvent from "./GuideEvent";
import Ticket from "./Ticket";
import GuideWanted from "./GuideWanted";
import GakuseiBungei from "./GakuseiBungei";
import ChildPainting from "./ChildPainting";
import GuideAdvertisement from "./GuideAdvertisement";
import Advertisement from "./Advertisement";
import Flyer from "./Flyer";
import FlyerDetail from "./FlyerDetail";
import GuideBusiness from "./GuideBusiness";
import Forum from "./Forum";
import ForumHistory from "./ForumHistory";
import Award from "./Award";
import NewsPaperReport from "./NewsPaperReport";
import GuideBook from "./GuideBook";
import Book from "./Book";
import GuideShop from "./GuideShop";
import Shop from "./Shop";
import GuideContactUs from "./GuideContactUs";
import GuideTerms from "./GuideTerms";
import DailyRight from "./DailyRight";
import Footer from "./Footer";

const page404 = () => <div><h1>404</h1>存在しないページです</div>  //<= ヒットしなかった時用のページを追加
const page999 = () => <div><Identity /><Footer /></div>

const Menu = () => {
  return (
    <Router>
      <Box className="main-wrap">
        <Switch>
          <Route path='/' exact component={Home}/>
          <Route path='/identity' exact component={Identity}/>
          <Route path='/planofaction' exact component={PlanOfAction}/>
          <Route path='/history' exact component={History}/>
          <Route path='/internship' exact component={InternShip}/>
          <Route path='/recruit' exact component={Recruit}/>
          <Route path='/tour' exact component={Tour}/>
          <Route path='/tour/album/2018' exact component={TourAlbum2018}/>
          <Route path='/tour/album/2019' exact component={TourAlbum2019}/>
          <Route path='/tour/album/2020' exact component={TourAlbum2020}/>
          <Route path='/tour/album/2021' exact component={TourAlbum2021}/>
          <Route path='/event' exact component={Event}/>
          <Route path='/guide-business/childpainting' exact component={ChildPainting}/>
          <Route path='/event/newspaperreport' exact component={NewsPaperReport}/>
          <Route path='/bunka/gakuseibungei' exact component={GakuseiBungei}/>
          <Route path='/forum' exact component={Forum}/>
          <Route path='/forum/history' exact component={ForumHistory}/>
          <Route path='/award' exact component={Award}/>
          <Route path='/support' exact component={Support}/>
          <Route path='/subscription' exact component={SubScription}/>
          <Route path='/shop' exact component={Shop}/>
          <Route path='/hall' exact component={Hall}/>
          <Route path='/book' exact component={Book}/>
          <Route path='/printservice' exact component={PrintService}/>
          <Route path='/ticket' exact component={Ticket}/>
          <Route path='/advertisement' exact component={Advertisement}/>
          <Route path='/flyer' exact component={Flyer}/>
          <Route path='/flyerdetail' exact component={FlyerDetail}/>
          <Route path='/guide-overview' exact component={GuideOverView} />
          <Route path='/guide-recruit' exact component={GuideRecruit} />
          <Route path='/guide-facility' exact component={GuideFacility} />
          <Route path='/guide-service' exact component={GuideService} />
          <Route path='/guide-event' exact component={GuideEvent} />
          <Route path='/guide-wanted' exact component={GuideWanted} />
          <Route path='/guide-advertisement' exact component={GuideAdvertisement} />
          <Route path='/guide-business' exact component={GuideBusiness} />
          <Route path='/guide-book' exact component={GuideBook} />
          <Route path='/guide-shop' exact component={GuideShop} />
          <Route path='/guide-contactus' exact component={GuideContactUs} />
          <Route path='/guide-terms' exact component={GuideTerms} />
          <Route path='/daily-right' exact component={DailyRight} />
          <Route exact component={page404}/>
        </Switch>
      </Box>
    </Router>
  )
}

export default Menu;
